import React from 'react'
import BugItem from './BugItem'

const BugItems = ({bugsList, bugs}) => {
  return (
    <section className='mt-3'>
        {bugsList.map(bug=>(
            <BugItem key={bug.id} bug={bug} bugs={bugs}/>
        ))}
    </section>
  )
}

export default BugItems
